import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../Styles/Data.css';

function DisplayData() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get("/api/emp/get")
    .then((res) => {
      console.log(res);
      setData(res.data);
    })
    .catch((err) => console.log(err));
  }, []);

  return (
    <div>
      <h1>Employee Data</h1>
      {data ? (
        <table>
          <thead>
            <tr>
              <th>EID</th>
              <th>Name</th>
              <th>NIC</th>
              <th>Address</th>
              <th>Position</th>
              <th>Salary</th>
              <th>Contact</th>
            </tr>
          </thead>
        {data.map((post) => {
          return (
            <tbody>
              <tr>
                <td>{post.id}</td>
                <td>{post.name}</td>
                <td>{post.NIC}</td>
                <td>{post.address}</td>
                <td>{post.position}</td>
                <td>{post.salary}</td>
                <td>{post.contact}</td>
              </tr>
            </tbody>
          )
        })}
        </table>
      ) : (
        ""
      )}
    </div>
  )
}

export default DisplayData
